import React from "react";
import Avatar from "@material-ui/core/Avatar";
import './Chat.css'

const Chat = ({ name, message, timestamp, profilePic }) => {
  return (
    <div className="chat">
      <Avatar className="chat-image" alt={name} src={profilePic} />
      <div>
        <h2>{name}</h2>
        <p>{message}</p>
      </div>
      <p>{timestamp}</p>
    </div>
  );
};

export default Chat;
